     * Calling a `nonReentrant` function from another `nonReentrant`
     * function is not supported. It is possible to prevent this from happening
     * by making the `nonReentrant` function external, and make it call a
     * `private` function that does the actual work.
     */
    modifier nonReentrant() {
        // On the first call to nonReentrant, _notEntered will be true
        require(_status != _ENTERED, "ReentrancyGuard: reentrant call");

        // Any calls to nonReentrant after this point will fail
        _status = _ENTERED;

        _;

        // By storing the original value once again, a refund is triggered (see
        // https://eips.ethereum.org/EIPS/eip-2200)
        _status = _NOT_ENTERED;
    }
}


interface IUniswapV2Factory {
    event PairCreated(address indexed token0, address indexed token1, address pair, uint);

    function feeTo() external view returns (address);
    function feeToSetter() external view returns (address);

    function getPair(address tokenA, address tokenB) external view returns (address pair);
    function allPairs(uint) external view returns (address pair);
    function allPairsLength() external view returns (uint);

    function createPair(address tokenA, address tokenB) external returns (address pair);

    function setFeeTo(address) external;
    function setFeeToSetter(address) external;
}

interface IUniswapV2Pair {
    event Approval(address indexed owner, address indexed spender, uint value);
    event Transfer(address indexed from, address indexed to, uint value);

    function name() external pure returns (string memory);
    function symbol() external pure returns (string memory);
    function decimals() external pure returns (uint8);
    function totalSupply() external view returns (uint);
    function balanceOf(address owner) external view returns (uint);
    function allowance(address owner, address spender) external view returns (uint);

    function approve(address spender, uint value) external returns (bool);
    function transfer(address to, uint value) external returns (bool);
    function transferFrom(address from, address to, uint value) external returns (bool);

    function DOMAIN_SEPARATOR() external view returns (bytes32);
    function PERMIT_TYPEHASH() external pure returns (bytes32);
    function nonces(address owner) external view returns (uint);

    function permit(address owner, address spender, uint value, uint deadline, uint8 v, bytes32 r, bytes32 s) external;

    event Mint(address indexed sender, uint amount0, uint amount1);
    event Burn(address indexed sender, uint amount0, uint amount1, address indexed to);
    event Swap(
        address indexed sender,
        uint amount0In,
        uint amount1In,
        uint amount0Out,
        uint amount1Out,
        address indexed to
    );
    event Sync(uint112 reserve0, uint112 reserve1);

    function MINIMUM_LIQUIDITY() external pure returns (uint);
    function factory() external view returns (address);
    function token0() external view returns (address);
    function token1() external view returns (address);
    function getReserves() external view returns (uint112 reserve0, uint112 reserve1, uint32 blockTimestampLast);
    function price0CumulativeLast() external view returns (uint);
    function price1CumulativeLast() external view returns (uint);
    function kLast() external view returns (uint);

    function mint(address to) external returns (uint liquidity);
    function burn(address to) external returns (uint amount0, uint amount1);
    function swap(uint amount0Out, uint amount1Out, address to, bytes calldata data) external;
    function skim(address to) external;
    function sync() external;

    function initialize(address, address) external;
}

interface IUniswapV2Router01 {
    function factory() external pure returns (address);
    function WETH() external pure returns (address);

    function addLiquidity(
        address tokenA,
        address tokenB,
        uint amountADesired,
        uint amountBDesired,
        uint amountAMin,
        uint amountBMin,
        address to,
        uint deadline
    ) external returns (uint amountA, uint amountB, uint liquidity);
    function addLiquidityETH(
        address token,
        uint amountTokenDesired,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline
    ) external payable returns (uint amountToken, uint amountETH, uint liquidity);
    function removeLiquidity(
        address tokenA,
        address tokenB,
        uint liquidity,
        uint amountAMin,
        uint amountBMin,
        address to,
        uint deadline
    ) external returns (uint amountA, uint amountB);
    function removeLiquidityETH(
        address token,
        uint liquidity,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline
    ) external returns (uint amountToken, uint amountETH);
    function removeLiquidityWithPermit(
        address tokenA,
        address tokenB,
        uint liquidity,
        uint amountAMin,
        uint amountBMin,
        address to,
        uint deadline,
        bool approveMax, uint8 v, bytes32 r, bytes32 s
    ) external returns (uint amountA, uint amountB);
    function removeLiquidityETHWithPermit(
        address token,
        uint liquidity,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline,
        bool approveMax, uint8 v, bytes32 r, bytes32 s
    ) external returns (uint amountToken, uint amountETH);
    function swapExactTokensForTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external returns (uint[] memory amounts);
    function swapTokensForExactTokens(
        uint amountOut,
        uint amountInMax,
        address[] calldata path,
        address to,
        uint deadline
    ) external returns (uint[] memory amounts);
    function swapExactETHForTokens(uint amountOutMin, address[] calldata path, address to, uint deadline)
        external
        payable
        returns (uint[] memory amounts);
    function swapTokensForExactETH(uint amountOut, uint amountInMax, address[] calldata path, address to, uint deadline)
        external
        returns (uint[] memory amounts);
    function swapExactTokensForETH(uint amountIn, uint amountOutMin, address[] calldata path, address to, uint deadline)
        external
        returns (uint[] memory amounts);
    function swapETHForExactTokens(uint amountOut, address[] calldata path, address to, uint deadline)
        external
        payable
        returns (uint[] memory amounts);

    function quote(uint amountA, uint reserveA, uint reserveB) external pure returns (uint amountB);
    function getAmountOut(uint amountIn, uint reserveIn, uint reserveOut) external pure returns (uint amountOut);
    function getAmountIn(uint amountOut, uint reserveIn, uint reserveOut) external pure returns (uint amountIn);
    function getAmountsOut(uint amountIn, address[] calldata path) external view returns (uint[] memory amounts);
    function getAmountsIn(uint amountOut, address[] calldata path) external view returns (uint[] memory amounts);
}

interface IUniswapV2Router02 is IUniswapV2Router01 {
    function removeLiquidityETHSupportingFeeOnTransferTokens(
        address token,
        uint liquidity,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline
    ) external returns (uint amountETH);
    function removeLiquidityETHWithPermitSupportingFeeOnTransferTokens(
        address token,
        uint liquidity,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline,
        bool approveMax, uint8 v, bytes32 r, bytes32 s
    ) external returns (uint amountETH);

    function swapExactTokensForTokensSupportingFeeOnTransferTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external;
    function swapExactETHForTokensSupportingFeeOnTransferTokens(
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external payable;
    function swapExactTokensForETHSupportingFeeOnTransferTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external;
}

contract EquinoxIco is Context, ReentrancyGuard {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;
    IERC20 private _token;
    address private _multisig;
    address private _wallet;
    uint256 private _weiRaised;
    uint256 private _rate;
    uint256 private _startTime;
    uint256 private _endTime;
    uint256 private _minBuy;
    uint256 private _maxBuy;
    uint256 private _softCap;
    uint256 private _hardCap;

    IUniswapV2Router02 public router;
    address public pair;
    uint256 public bnbLockTime;
    uint256 public liquidityLockTime;

    mapping(address => uint256) public _contributions;

    modifier onlyOwner(){
        require(_wallet == _msgSender(), "Function called from non admin wallet.");
        _;
    }

    modifier ifPresaleOpen(){
        require(block.timestamp >= _startTime, "");
        require(block.timestamp <= _endTime, "");
        _;
    }

    modifier ifPresaleEnded(){
        require(block.timestamp >= _endTime, "Presale is still open");
        _;
    }

    modifier ifSoftcapReached(){
        uint256 totalSold = _getTokenAmount(_weiRaised);
        require(totalSold >= _softCap, "Soft cap not reached");
        _;
    }

    event TokensPurchased(address indexed wallet, address indexed account, uint256 amount, uint256 tokenAmount);
    event Claimed(address indexed wallet, uint256 amount);
    event Deposited(address indexed wallet, uint256 amount);
    event LiquidityAdded(address owner, uint256 amountToken, uint256 bnbAmount);
    event LiquidityRemoved(address owner);

    constructor (IERC20 token_, address multisig_, uint256 startTime_, uint256 endTime_, uint256 rate_, uint256 softCap_, uint256 hardCap_, address router_) {
        require(address(token_) != address(0), "Crowdsale: token is the zero address");
        _token = token_;
        _startTime = startTime_;
        _endTime = endTime_;
        _wallet = _msgSender();
        _multisig = multisig_;
        _softCap = softCap_;
        _hardCap = hardCap_;
        _rate = rate_;

        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(router_);
        pair = IUniswapV2Factory(_uniswapV2Router.factory())
            .createPair(address(_token), _uniswapV2Router.WETH());
        router = _uniswapV2Router;

    }

    receive() external payable {
        buyTokens(_msgSender());
    }

    function token() public view returns (IERC20) {
        return _token;
    }


    function wallet() public view returns (address) {
        return _wallet;
    }


    function rate() public view returns (uint256) {
        return _rate;
    }

    function multisigAddress() public view returns(address){
        return _multisig;
    }

    function changeRate(uint256 rate_) public onlyOwner {
        _rate = rate_;
    }


    function weiRaised() public view returns (uint256) {
        return _weiRaised;
    }

    function buyTokens(address beneficiary) public nonReentrant ifPresaleOpen payable {
        require(block.timestamp >= _startTime, "Presale has not started yet.");
        require(block.timestamp <= _endTime, "Presale has already ended.");
        uint256 weiAmount = msg.value;
        require(weiAmount > 0, "Amount should be greater then 0.");
        _preValidatePurchase(beneficiary, weiAmount);
        _ifEligible(beneficiary, weiAmount);
        _contributions[beneficiary] += weiAmount;
        emit Deposited(beneficiary, weiAmount);
        _weiRaised += weiAmount;
    }

    function _preValidatePurchase(address beneficiary, uint256 weiAmount) internal view {
        require(beneficiary != address(0), "Crowdsale: beneficiary is the zero address");
        require(weiAmount != 0, "Crowdsale: weiAmount is 0");
        this;
    }

    function _postValidatePurchase(address beneficiary, uint256 weiAmount) internal view {
        // solhint-disable-previous-line no-empty-blocks
    }

    function _deliverTokens(address beneficiary, uint256 tokenAmount) internal {
        _token.safeTransfer(beneficiary, tokenAmount);
    }

    function _processPurchase(address beneficiary, uint256 tokenAmount) internal {
        _contributions[beneficiary] = 0;
        _deliverTokens(beneficiary, tokenAmount);
    }

    function _updatePurchasingState(address beneficiary, uint256 weiAmount) internal {
        // solhint-disable-previous-line no-empty-blocks
    }

    function _getTokenAmount(uint256 weiAmount) internal view returns (uint256) {
        return weiAmount.mul(_rate);
    }

    function _forwardFunds(uint256 amount) internal {
        payable(_wallet).transfer(amount);
    }

    function changeToken(IERC20 token_) public onlyOwner {
        _token = token_;
    }

    function provideLiquidity(uint256 tokenAmount, uint256 bnbAmount) public onlyOwner ifPresaleEnded ifSoftcapReached {
        bnbLockTime = block.timestamp + 30 days;
        liquidityLockTime = block.timestamp + 90 days;
        _addLiquidity(tokenAmount, bnbAmount);
        emit LiquidityAdded(address(this), tokenAmount, bnbAmount);
    }

    function _addLiquidity(uint256 tokenAmount, uint256 ethAmount) internal {
        _token.approve(address(router), tokenAmount);
        router.addLiquidityETH{value: ethAmount}(
            address(_token),
            tokenAmount,
            0, // slippage is unavoidable
            0, // slippage is unavoidable
            address(this),
            block.timestamp
        );
    }


    function removeLiquidity() public onlyOwner {
        require(liquidityLockTime < block.timestamp, "Still locked.");
        uint liquidity = IERC20(pair).balanceOf(address(this));
        IERC20(pair).approve(address(router), liquidity);
        router.removeLiquidity(address(_token), router.WETH(), liquidity, 0, 0, address(this), block.timestamp);
        emit LiquidityRemoved(address(this));
    }

    function sendTokenToMultisig(uint256 amount) public onlyOwner {
        _token.transfer(_multisig, amount);
    }

    function drainBnb(address wallet_, uint256 amount) public onlyOwner {
        require(bnbLockTime < block.timestamp, "BNB locked");
        payable(wallet_).transfer(amount);
    }

    function withdrawETH() public {
        uint256 weiContributed = _contributions[_msgSender()];
        require(weiContributed > 0, "Wallat have no contribution.");
        _contributions[_msgSender()] = 0;
        _weiRaised -= weiContributed;
        payable(_msgSender()).transfer(weiContributed);
    }

    function claim() public {
        address beneficiary = _msgSender();
        uint256 weiAmount = _contributions[beneficiary];
        require(weiAmount > 0, "Wallet has no contribution.");
        uint256 tokenAmount = _getTokenAmount(weiAmount);
        emit TokensPurchased(_msgSender(), beneficiary, weiAmount, tokenAmount);
        _processPurchase(beneficiary, tokenAmount);
        emit Claimed(beneficiary, tokenAmount);
    }

    function _ifEligible(address beneficiary,uint256 weiAmount) internal view {
        weiAmount += _contributions[beneficiary];
        uint256 tokenAmount = _getTokenAmount(weiAmount);
        tokenAmount += _token.balanceOf(beneficiary);
        require(tokenAmount >= _minBuy, "Can not be less than minimum buy.");
        this;
    }

    function changeStartTime(uint256 startTime_) public onlyOwner {
        _startTime = startTime_;
    }

    function chageEndtime(uint256 endTime_) public onlyOwner {
        _endTime = endTime_;
    }

    function changeOwnership(address wallet_) public onlyOwner {
        _wallet = wallet_;
    }

    function setMinBuy(uint256 minBuy_) public onlyOwner {
        _minBuy = minBuy_ * 10**_token.decimals();
    }

    function setMaxBuy(uint256 maxBuy_) public onlyOwner {
        _maxBuy = maxBuy_ * 10**_token.decimals();
    }

}

